import React from 'react'
import "../MainMenu/MainMenu.css"
import menu from "../../Data/MenuData"
import vegicon from "../../../Images/veg-icon.png"
import nonVegicon from "../../../Images/non-veg icon.png"
import star from "../../../Images/star-icon.png"

function MainMenu() {
  return (
    <div>
      <h1>Recommended</h1>
      <p>5 items</p>
      <div>
        {
          menu.map((item)=>{
            return(
              <div>
                  <div className="icon-container">
                      <div className='vegicons' key={item.id}>
                        <img alt="Veg icon" className='icons' src={`${item.isVeg===true?vegicon:nonVegicon}`}/>
                  </div>
              <div style={{display:item.isBestseller?'block':'none'}}>
                <img className='besticon' src={star}/>
              </div>
              </div>
              </div>
            )
          })
        }
      </div>
    </div>
  )
}

export default MainMenu
